import React from 'react';


const horizontalLineStyle = {
    height: '1px',
    width: '70%',
    backgroundColor: '#3d3d3d',
}

class HorizontalLine extends React.Component {
    render() {
        return (
            < div style={horizontalLineStyle} ></div >
        );
    }
}


export default HorizontalLine;
